    "#CAPTCHA 1 - Generate random list of words which must be input correctly. Quite simple, added some logic to simulating users being 'locked out'\n",
    "\n",
    "#Generate word list\n",
    "\n",
    "words = 'bait memorial plagiarize drain mail aviation reserve doll damage horoscope business bark lonely beach staircase appointment chest stretch reconcile replacement unfair middle prove timetable honor definition wood insurance buy Koran herd to dip realism president access chorus entertain edge deprive assault advice fit image cellar chord book integrated conflict freighter'\n",
    "word_list = words.split()"
