    "#CAPTCHA 2 - Generate two random strings of alphanumeric characters. Very similar to CAPTCHA 1, no problem\n",
    "\n",
    "import string\n",
    "\n",
    "#Generate a list consisting of all alphabetical letters and digits. Includes both lower and upper case\n",
    "\n",
    "characters = list(string.ascii_letters + string.digits)\n",
    "\n",
    "def randomstrings():\n",
    "    stringone = ''\n",
    "    stringtwo = ''\n",
    "    fail_counter = 0\n",
    "\n",
    "    #Add a random number of random characters to stringone\n",
    "    for x in range(random.randint(1,15)):\n",
    "        stringone = stringone + str(characters[random.randrange(62)])\n",
    "        \n",
    "    #Repeat for stringtwo\n",
    "    for x in range(random.randint(1,15)):\n",
    "        stringtwo = stringtwo + str(characters[random.randrange(62)])\n",
    "\n",
    "    #Join together\n",
    "    finalstring = stringone+' '+stringtwo\n",
    "    print(finalstring)\n",
    "\n",
    "    #Ask user to copy sentence\n",
    "    \n",
    "    user_input = input('Please copy the Captcha above: ')\n",
    "\n",
    "    while user_input != finalstring:\n",
    "\n",
    "    #On failure add 1 to fail counter, warn user of fail, and lock-out if they have failed 3 times.\n",
    "        \n",
    "        fail_counter += 1\n",
    "\n",
    "        if fail_counter == 3:\n",
    "            return 'Too many failed attempts. Account locked.'\n",
    "            break\n",
    "        \n",
    "        user_input = input(f'Incorrect input! Fail count: {fail_counter} Please try again: ')\n",
    "\n",
    "    return 'Successful input. Access granted.'"
